import './Container.css'
import img from './view.jpeg'

function Container() {
    return(
        <section className="container">
            <div className="images">
                <img src={img}></img>
            </div>
            <div className="overlay"></div>
            <div className="info">
                <h2>Know more about Sankranti</h2>
            </div>
        </section>
    );
}

export default Container;
